contracts/modules/Marketplace/NTicketMar.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.10;

import {IMarketplace} from '../../interfaces/IMarketplace.sol';
import {ITicketNFT} from '../../interfaces/ITicketNFT.sol';
import {IERC1155} from '@openzeppelin/contracts/token/ERC1155/IERC1155.sol';
import {ERC2981} from '@openzeppelin/contracts/token/common/ERC2981.sol';
import {IERC20} from '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import {DebugBase} from '../../utils/DebugBase.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

import './Structs.sol';

contract NTicketMarket is IMarketplace, DebugBase, Ownable {
    address public ticketContract;
    address public ftContract;
    address public specialMomentContract;

    mapping(uint256 => Listing) private ticketListings;
    mapping(uint256 => SpecialMomentListing) private specialMomentListings;

    // Ticket Events
    event TicketListed(
        uint256 tokenId,
        address seller,
        uint256 price,
        uint64 eventId,
        uint64 categoryId,
        uint128 seatId
    );
    event TicketListingUpdated(
        uint256 tokenId,
        address seller,
        uint256 oldPrice,
        uint256 newPrice
    );
    event TicketListingCancelled(uint256 tokenId, address seller);
    event TicketSold(
        uint256 tokenId,
        address seller,
        address buyer,
        uint256 price
    );

    // Special Moment Events
    event SpecialMomentListed(uint256 tokenId, address seller, uint256 price);
    event SpecialMomentListingUpdated(
        uint256 tokenId,
        address seller,
        uint256 oldPrice,
        uint256 newPrice
    );
    event SpecialMomentListingCancelled(uint256 tokenId, address seller);
    event SpecialMomentSold(
        uint256 tokenId,
        address seller,
        address buyer,
        uint256 price
    );

    constructor(
        address _ticketContract,
        address _ftContract,
        address _specialMomentContract
    ) Ownable(msg.sender) {
        ticketContract = _ticketContract;
        ftContract = _ftContract;
        specialMomentContract = _specialMomentContract;
        _debugMode = true;
    }

    // Ticket Modifiers
    modifier ticketNotListed(uint256 tokenId, address owner) {
        _debug(
            'ticketNotListed',
            'Checking if ticket is already listed',
            abi.encode(tokenId, owner)
        );
        Listing memory listing = ticketListings[tokenId];
        if (listing.price > 0) {
            revert('Ticket already listed');
        }
        _;
    }

    modifier ticketIsListed(uint256 tokenId) {
        _debug(
            'ticketIsListed',
            'Checking if ticket is listed',
            abi.encode(tokenId)
        );
        Listing memory listing = ticketListings[tokenId];
        if (listing.price <= 0) {
            revert('Ticket not listed');
        }
        _;
    }

    modifier isTicketOwner(uint256 tokenId, address spender) {
        _debug(
            'isTicketOwner',
            'Checking ticket ownership',
            abi.encode(tokenId, spender)
        );
        uint256 balance = IERC1155(ticketContract).balanceOf(spender, tokenId);
        if (balance == 0) {
            revert('Ticket not owned by caller');
        }
        _;
    }

    // Special Moment Modifiers
    modifier specialMomentNotListed(uint256 tokenId, address owner) {
        _debug(
            'specialMomentNotListed',
            'Checking if special moment is already listed',
            abi.encode(tokenId, owner)
        );
        SpecialMomentListing memory listing = specialMomentListings[tokenId];
        if (listing.price > 0) {
            revert('Special moment already listed');
        }
        _;
    }

    modifier specialMomentIsListed(uint256 tokenId) {
        _debug(
            'specialMomentIsListed',
            'Checking if special moment is listed',
            abi.encode(tokenId)
        );
        SpecialMomentListing memory listing = specialMomentListings[tokenId];
        if (listing.price <= 0) {
            revert('Special moment not listed');
        }
        _;
    }

    modifier isSpecialMomentOwner(uint256 tokenId, address spender) {
        _debug(
            'isSpecialMomentOwner',
            'Checking special moment ownership',
            abi.encode(tokenId, spender)
        );
        uint256 balance = IERC1155(specialMomentContract).balanceOf(
            spender,
            tokenId
        );
        if (balance == 0) {
            revert('Special moment not owned by caller');
        }
        _;
    }

    // Ticket Functions
    function listTicket(
        uint256 tokenId,
        uint256 price
    )
        external
        emitDebug('listTicket')
        ticketNotListed(tokenId, msg.sender)
        isTicketOwner(tokenId, msg.sender)
    {
        _debug(
            'listTicket',
            'Checking marketplace approval',
            abi.encode(msg.sender, address(this))
        );
        bool approved = IERC1155(ticketContract).isApprovedForAll(
            msg.sender,
            address(this)
        );
        if (!approved) {
            revert('Marketplace is not approved');
        }
        if (price <= 0) {
            revert('Price must be greater than zero');
        }

        _debug('listTicket', 'Creating listing', abi.encode(tokenId, price));
        ticketListings[tokenId] = Listing(price, msg.sender);

        (uint64 eventId, uint64 categoryId, uint128 seatId) = _decodeTokenId(
            tokenId
        );

        emit TicketListed(
            tokenId,
            msg.sender,
            price,
            eventId,
            categoryId,
            seatId
        );
    }

    function cancelTicketListing(
        uint256 tokenId
    )
        external
        emitDebug('cancelTicketListing')
        ticketIsListed(tokenId)
        isTicketOwner(tokenId, msg.sender)
    {
        _debug(
            'cancelTicketListing',
            'Deleting listing',
            abi.encode(tokenId, msg.sender)
        );
        delete (ticketListings[tokenId]);
        emit TicketListingCancelled(tokenId, msg.sender);
    }

    function buyTicket(
        uint256 tokenId
    ) external emitDebug('buyTicket') ticketIsListed(tokenId) {
        _debug('buyTicket', 'Loading listing details', abi.encode(tokenId));
        Listing memory listing = ticketListings[tokenId];

        if (msg.sender == listing.seller) {
            revert('Cannot buy your own listing');
        }

        _debug(
            'buyTicket',
            'Checking USDC allowance',
            abi.encode(msg.sender, listing.price)
        );
        if (
            IERC20(ftContract).allowance(msg.sender, address(this)) <
            listing.price
        ) {
            revert('Insufficient USDC allowance');
        }

        _debug(
            'buyTicket',
            'Calculating royalties',
            abi.encode(tokenId, listing.price)
        );
        (address eventOwner, uint256 royaltyAmount) = ERC2981(ticketContract)
            .royaltyInfo(tokenId, listing.price);

        _debug(
            'buyTicket',
            'Processing royalty payment',
            abi.encode(eventOwner, royaltyAmount)
        );
        IERC20(ftContract).transferFrom(msg.sender, eventOwner, royaltyAmount);

        _debug(
            'buyTicket',
            'Processing seller payment',
            abi.encode(listing.seller, listing.price - royaltyAmount)
        );
        IERC20(ftContract).transferFrom(
            msg.sender,
            listing.seller,
            listing.price - royaltyAmount
        );

        _debug(
            'buyTicket',
            'Transferring NFT',
            abi.encode(listing.seller, msg.sender, tokenId)
        );
        IERC1155(ticketContract).safeTransferFrom(
            listing.seller,
            msg.sender,
            tokenId,
            1,
            ''
        );

        delete ticketListings[tokenId];
        emit TicketSold(tokenId, listing.seller, msg.sender, listing.price);
    }

    function updateTicketListing(
        uint256 tokenId,
        uint256 newPrice
    )
        external
        emitDebug('updateTicketListing')
        ticketIsListed(tokenId)
        isTicketOwner(tokenId, msg.sender)
    {
        if (newPrice <= 0) {
            revert('Price must be greater than zero');
        }

        _debug(
            'updateTicketListing',
            'Updating listing price',
            abi.encode(tokenId, newPrice)
        );
        uint256 oldPrice = ticketListings[tokenId].price;
        ticketListings[tokenId].price = newPrice;

        emit TicketListingUpdated(tokenId, msg.sender, oldPrice, newPrice);
    }

    function getTicketListing(
        uint256 tokenId
    ) external view returns (Listing memory) {
        Listing memory listing = ticketListings[tokenId];
        if (listing.price <= 0) {
            revert('Ticket not listed');
        }
        return listing;
    }

    // Special Moment Functions
    function listSpecialMoment(
        uint256 tokenId,
        uint256 price
    )
        external
        emitDebug('listSpecialMoment')
        specialMomentNotListed(tokenId, msg.sender)
        isSpecialMomentOwner(tokenId, msg.sender)
    {
        _debug(
            'listSpecialMoment',
            'Checking marketplace approval',
            abi.encode(msg.sender, address(this))
        );
        bool approved = IERC1155(specialMomentContract).isApprovedForAll(
            msg.sender,
            address(this)
        );
        if (!approved) {
            revert('Marketplace is not approved');
        }
        if (price <= 0) {
            revert('Price must be greater than zero');
        }

        _debug(
            'listSpecialMoment',
            'Creating listing',
            abi.encode(tokenId, price)
        );
        specialMomentListings[tokenId] = SpecialMomentListing(
            price,
            msg.sender
        );

        emit SpecialMomentListed(tokenId, msg.sender, price);
    }

    function cancelSpecialMomentListing(
        uint256 tokenId
    )
        external
        emitDebug('cancelSpecialMomentListing')
        specialMomentIsListed(tokenId)
        isSpecialMomentOwner(tokenId, msg.sender)
    {
        _debug(
            'cancelSpecialMomentListing',
            'Deleting listing',
            abi.encode(tokenId, msg.sender)
        );
        delete (specialMomentListings[tokenId]);
        emit SpecialMomentListingCancelled(tokenId, msg.sender);
    }

    function buySpecialMoment(
        uint256 tokenId
    ) external emitDebug('buySpecialMoment') specialMomentIsListed(tokenId) {
        _debug(
            'buySpecialMoment',
            'Loading listing details',
            abi.encode(tokenId)
        );
        SpecialMomentListing memory listing = specialMomentListings[tokenId];

        if (msg.sender == listing.seller) {
            revert('Cannot buy your own listing');
        }

        _debug(
            'buySpecialMoment',
            'Checking USDC allowance',
            abi.encode(msg.sender, listing.price)
        );
        if (
            IERC20(ftContract).allowance(msg.sender, address(this)) <
            listing.price
        ) {
            revert('Insufficient USDC allowance');
        }

        _debug(
            'buySpecialMoment',
            'Calculating royalties',
            abi.encode(tokenId, listing.price)
        );
        (address eventOwner, uint256 royaltyAmount) = ERC2981(
            specialMomentContract
        ).royaltyInfo(tokenId, listing.price);

        _debug(
            'buySpecialMoment',
            'Processing royalty payment',
            abi.encode(eventOwner, royaltyAmount)
        );
        IERC20(ftContract).transferFrom(msg.sender, eventOwner, royaltyAmount);

        _debug(
            'buySpecialMoment',
            'Processing seller payment',
            abi.encode(listing.seller, listing.price - royaltyAmount)
        );
        IERC20(ftContract).transferFrom(
            msg.sender,
            listing.seller,
            listing.price - royaltyAmount
        );

        _debug(
            'buySpecialMoment',
            'Transferring NFT',
            abi.encode(listing.seller, msg.sender, tokenId)
        );
        IERC1155(specialMomentContract).safeTransferFrom(
            listing.seller,
            msg.sender,
            tokenId,
            1,
            ''
        );

        delete specialMomentListings[tokenId];
        emit SpecialMomentSold(
            tokenId,
            listing.seller,
            msg.sender,
            listing.price
        );
    }

    function updateSpecialMomentListing(
        uint256 tokenId,
        uint256 newPrice
    )
        external
        emitDebug('updateSpecialMomentListing')
        specialMomentIsListed(tokenId)
        isSpecialMomentOwner(tokenId, msg.sender)
    {
        if (newPrice <= 0) {
            revert('Price must be greater than zero');
        }

        _debug(
            'updateSpecialMomentListing',
            'Updating listing price',
            abi.encode(tokenId, newPrice)
        );
        uint256 oldPrice = specialMomentListings[tokenId].price;
        specialMomentListings[tokenId].price = newPrice;

        emit SpecialMomentListingUpdated(
            tokenId,
            msg.sender,
            oldPrice,
            newPrice
        );
    }

    function getSpecialMomentListing(
        uint256 tokenId
    ) external view returns (SpecialMomentListing memory) {
        SpecialMomentListing memory listing = specialMomentListings[tokenId];
        if (listing.price <= 0) {
            revert('Special moment not listed');
        }
        return listing;
    }

    function setDebugMode(bool mode) external override onlyOwner {
        _debugMode = mode;
    }

    function _decodeTokenId(
        uint256 tokenId
    )
        internal
        pure
        returns (uint64 eventId, uint64 categoryId, uint128 seatId)
    {
        eventId = uint64(tokenId >> 192);
        categoryId = uint64((tokenId >> 128) & ~uint64(0));
        seatId = uint128(tokenId & ~uint128(0));
    }
}

