// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.10;

import '../interfaces/IDebuggable.sol';

abstract contract DebugBase is IDebuggable {
    bool internal _debugMode;

    modifier emitDebug(string memory methodName) {
        if (_debugMode) {
            emit Debug(methodName, 'Method entry', '');
        }
        _;
        if (_debugMode) {
            emit Debug(methodName, 'Method exit', '');
        }
    }

    function _debug(
        string memory methodName,
        string memory message,
        bytes memory data
    ) internal {
        if (_debugMode) {
            emit Debug(methodName, message, data);
        }
    }

    function debugMode() public view returns (bool) {
        return _debugMode;
    }

    function setDebugMode(bool mode) external virtual {
        _debugMode = mode;
    }
}

